({ 
  headline1Text = 'High-Performance Cloud Solutions', 
  headline2Text = 'Empowering Your Digital Infrastructure', 
  ctaText = 'Get Started', 
  ctaHref = '/signup',
  backgroundImageSrc = '/images/cloud-hero-bg.webp',
  backgroundImageAlt = 'Global Cloud Infrastructure',
  subheadlineText = 'Reliable, Scalable, and Cost-Effective Hosting Services'
}) => {
  const [isHovered, setIsHovered] = React.useState(false);

  return (
    <section 
      className="relative w-full min-h-[600px] flex items-center justify-center overflow-hidden"
      aria-label="Hero Section"
    >
      {/* Background Image with Overlay */}
      <div className="absolute inset-0 z-0">
        <img 
          src={backgroundImageSrc} 
          alt={backgroundImageAlt}
          className="w-full h-full object-cover opacity-20"
        />
        <div className="absolute inset-0 bg-[#0D47A1] opacity-70"></div>
      </div>

      {/* Content Container */}
      <div className="relative z-10 max-w-4xl text-center px-4 py-16">
        <h1 
          className="text-white font-inter font-bold text-3xl md:text-5xl mb-4"
          aria-label="Main Headline"
        >
          {headline1Text}
        </h1>
        <h2 
          className="text-white font-roboto font-light text-xl md:text-2xl mb-6 opacity-90"
          aria-label="Subheadline"
        >
          {subheadlineText}
        </h2>

        {/* Call to Action Button */}
        <a 
          href={ctaHref}
          onMouseEnter={() => setIsHovered(true)}
          onMouseLeave={() => setIsHovered(false)}
          className={`
            inline-block px-6 py-3 rounded-lg 
            bg-[#FF6D00] text-white font-roboto font-medium
            transition-all duration-300 ease-in-out
            hover:bg-[#FF8F00] focus:outline-none focus:ring-2 
            focus:ring-[#FF6D00] focus:ring-opacity-50
            ${isHovered ? 'scale-105' : ''}
          `}
          aria-label="Get Started Button"
        >
          {ctaText}
        </a>
      </div>
    </section>
  );
}

({ 
  testimonial1Text = "Global Cloud's services exceeded our expectations. Reliable, fast, and incredibly supportive!", 
  testimonial1Name = "Michael Thompson", 
  testimonial1Position = "CTO, TechInnovate Solutions",
  testimonial1ImageSrc = "https://randomuser.me/api/portraits/men/32.jpg",
  testimonial2Text = "Seamless domain management and top-tier hosting - Global Cloud is our go-to cloud provider.", 
  testimonial2Name = "Sarah Rodriguez", 
  testimonial2Position = "Founder, WebScale Enterprises",
  testimonial2ImageSrc = "https://randomuser.me/api/portraits/women/44.jpg",
  testimonial3Text = "Incredible performance and cost-effective cloud solutions that truly understand our business needs.", 
  testimonial3Name = "Alex Chen", 
  testimonial3Position = "IT Director, CloudFirst Media"
}) => {
  const [currentSlide, setCurrentSlide] = React.useState(0);
  const testimonials = [
    { text: testimonial1Text, name: testimonial1Name, position: testimonial1Position, image: testimonial1ImageSrc },
    { text: testimonial2Text, name: testimonial2Name, position: testimonial2Position, image: testimonial2ImageSrc },
    { text: testimonial3Text, name: testimonial3Name, position: testimonial3Position, image: undefined }
  ];

  const nextSlide = () => {
    setCurrentSlide((prev) => (prev + 1) % testimonials.length);
  };

  const prevSlide = () => {
    setCurrentSlide((prev) => (prev - 1 + testimonials.length) % testimonials.length);
  };

  return (
    <section className="w-full py-16 bg-white dark:bg-gray-900 flex items-center justify-center">
      <div className="container mx-auto px-4 max-w-4xl">
        <div className="relative w-full overflow-hidden rounded-2xl bg-gray-100 dark:bg-gray-800 shadow-lg">
          <div className="relative flex transition-transform duration-500 ease-in-out" 
               style={{ transform: `translateX(-${currentSlide * 100}%)` }}>
            {testimonials.map((testimonial, index) => (
              <div key={index} className="w-full flex-shrink-0 flex flex-col md:flex-row items-center justify-center p-8 md:p-12">
                {testimonial.image && (
                  <div className="w-24 h-24 md:w-32 md:h-32 rounded-full overflow-hidden mr-0 md:mr-8 mb-4 md:mb-0">
                    <img 
                      src={testimonial.image} 
                      alt={`${testimonial.name} profile`} 
                      className="w-full h-full object-cover"
                    />
                  </div>
                )}
                <div className="text-center md:text-left">
                  <p className="text-lg md:text-xl text-gray-800 dark:text-gray-200 italic mb-4">
                    "{testimonial.text}"
                  </p>
                  <div>
                    <h4 className="text-lg font-semibold text-blue-900 dark:text-blue-300">
                      {testimonial.name}
                    </h4>
                    <p className="text-sm text-gray-600 dark:text-gray-400">
                      {testimonial.position}
                    </p>
                  </div>
                </div>
              </div>
            ))}
          </div>

          <div className="absolute inset-y-0 left-0 flex items-center">
            <button 
              onClick={prevSlide} 
              className="p-2 rounded-full bg-blue-50 dark:bg-blue-900 text-blue-600 dark:text-blue-300 hover:bg-blue-100 dark:hover:bg-blue-800 transition-colors"
              aria-label="Previous Testimonial"
            >
              <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 19l-7-7 7-7" />
              </svg>
            </button>
          </div>
          <div className="absolute inset-y-0 right-0 flex items-center">
            <button 
              onClick={nextSlide} 
              className="p-2 rounded-full bg-blue-50 dark:bg-blue-900 text-blue-600 dark:text-blue-300 hover:bg-blue-100 dark:hover:bg-blue-800 transition-colors"
              aria-label="Next Testimonial"
            >
              <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
              </svg>
            </button>
          </div>

          <div className="absolute bottom-4 left-0 right-0 flex justify-center space-x-2">
            {testimonials.map((_, index) => (
              <button 
                key={index} 
                onClick={() => setCurrentSlide(index)}
                className={`w-2 h-2 rounded-full transition-colors ${
                  currentSlide === index 
                    ? 'bg-blue-600 dark:bg-blue-300' 
                    : 'bg-gray-300 dark:bg-gray-600'
                }`}
                aria-label={`Go to testimonial ${index + 1}`}
              />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

({ 
  section1Title, 
  section1Description, 
  feature1Title, 
  feature1Description, 
  feature1ImageSrc, 
  feature2Title, 
  feature2Description, 
  feature2ImageSrc,
  feature3Title, 
  feature3Description, 
  feature3ImageSrc 
}) => {
  const features = [
    {
      title: feature1Title,
      description: feature1Description,
      imageSrc: feature1ImageSrc,
      icon: 'fluent:cloud-24-filled'
    },
    {
      title: feature2Title,
      description: feature2Description,
      imageSrc: feature2ImageSrc,
      icon: 'fluent:server-24-filled'
    },
    {
      title: feature3Title,
      description: feature3Description,
      imageSrc: feature3ImageSrc,
      icon: 'fluent:domain-24-filled'
    }
  ];

  return (
    <section className="w-full bg-white py-16 px-4 md:px-8 lg:px-16">
      <div className="max-w-7xl mx-auto">
        <div className="text-center mb-12">
          <h2 className="text-2xl md:text-3xl font-bold text-[#0D47A1] mb-4">
            {section1Title}
          </h2>
          <p className="text-[#607D8B] max-w-3xl mx-auto">
            {section1Description}
          </p>
        </div>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {features.map((feature, index) => (
            <React.Fragment key={index}>
              <div className="bg-[#F5F5F5] rounded-lg p-6 transform transition-all duration-300 hover:scale-105 hover:shadow-lg">
                <div className="flex items-center mb-4">
                  <div className="mr-4">
                    <Icon 
                      icon={feature.icon} 
                      className="w-12 h-12 text-[#0D47A1]" 
                    />
                  </div>
                  <h3 className="text-xl font-semibold text-[#0D47A1]">
                    {feature.title}
                  </h3>
                </div>
                <p className="text-[#607D8B]">
                  {feature.description}
                </p>
                {feature.imageSrc && (
                  <div className="mt-4 overflow-hidden rounded-md">
                    <img 
                      src={feature.imageSrc} 
                      alt={feature.title} 
                      className="w-full h-48 object-cover transition-transform duration-300 hover:scale-110"
                    />
                  </div>
                )}
              </div>
            </React.Fragment>
          ))}
        </div>
      </div>
    </section>
  );
}

({ 
  galleryItems1ImageSrc, 
  galleryItems1Title, 
  galleryItems1Description,
  galleryItems2ImageSrc, 
  galleryItems2Title, 
  galleryItems2Description,
  galleryItems3ImageSrc, 
  galleryItems3Title, 
  galleryItems3Description,
  sectionTitle,
  sectionSubtitle
}) => {
  const galleryItems = [
    {
      image: galleryItems1ImageSrc,
      title: galleryItems1Title,
      description: galleryItems1Description
    },
    {
      image: galleryItems2ImageSrc,
      title: galleryItems2Title,
      description: galleryItems2Description
    },
    {
      image: galleryItems3ImageSrc,
      title: galleryItems3Title,
      description: galleryItems3Description
    }
  ];

  return (
    <section className="w-full bg-white py-16 px-4 md:px-8 lg:px-16">
      <div className="max-w-7xl mx-auto text-center mb-12">
        <h2 className="text-2xl md:text-3xl lg:text-4xl font-bold text-[#0D47A1] mb-4">
          {sectionTitle}
        </h2>
        <p className="text-[#607D8B] max-w-2xl mx-auto">
          {sectionSubtitle}
        </p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
        {galleryItems.map((item, index) => (
          <div 
            key={index} 
            className="bg-[#F5F5F5] rounded-lg overflow-hidden shadow-md transition-all duration-300 hover:shadow-lg group"
          >
            <div className="relative overflow-hidden">
              <img 
                src={item.image} 
                alt={item.title}
                className="w-full h-64 object-cover transform transition-transform duration-300 group-hover:scale-105"
              />
            </div>
            <div className="p-6">
              <h3 className="text-xl font-semibold text-[#0D47A1] mb-3">
                {item.title}
              </h3>
              <p className="text-[#607D8B]">
                {item.description}
              </p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};
